  uint dnaDigits = 16;
  uint dnaModulus = 10 ** dnaDigits;

  struct Token {
    string value;
    bool wasted;
    bool activated;
  }

  struct Creature {
    uint value;
  }

  //Token[] public tokens;

  mapping (uint => Token) private tokens;
  mapping (uint => address) private tokenToOwner;
  mapping (address => uint) private ownerTokenCount;

  mapping (address => Creature) private creatures;

	function addToken(string token) public returns(bool sufficient) {
		uint id = uint(keccak256(token));
	    if (tokens[id].activated == true) return false;
	    tokens[id] = Token(token, false, false);
        tokenToOwner[uint(keccak256(token))] = address(0x0);//msg.sender;
		return true;
	}

	function getBalance(address addr) public view returns(uint) {
		return ownerTokenCount[addr];
	}

	function applyToken(string token) public returns(bool sufficient) {

	   uint id = uint(keccak256(token));
        if (tokens[id].activated == false) {
        tokenToOwner[id] = msg.sender;
        ownerTokenCount[msg.sender]++;
        tokens[id].activated = true;

		return true;
      }

		return false;
	}

	function generateCreature() public returns(bool sufficient) {
	    if (creatures[msg.sender].value == 0) {
	       creatures[msg.sender] = Creature(_generateRandomDna(toString(msg.sender)));
	       return true;
	    }

	   return false;
	}

	function reGenerateCreature(string token) public returns(bool sufficient) {
	  uint id = uint(keccak256(token));
	  if (tokens[id].wasted == false) {
	    creatures[msg.sender] = Creature(_generateRandomDna(token));
	    tokens[id].wasted = true;
        ownerTokenCount[msg.sender]--;

		return true;
      }

	  return false;
	}

	function getCreature(address addr) public returns(uint sufficient) {
	   return creatures[addr].value;
	}

  function _generateRandomDna(string _str) private view returns (uint) {
    uint rand = uint(keccak256(_str));
    return rand % dnaModulus;
  }

function toString(address x) returns (string) {
    bytes memory b = new bytes(20);
    for (uint i = 0; i < 20; i++)
        b[i] = byte(uint8(uint(x) / (2**(8*(19 - i)))));
    return string(b);
}

